import React from 'react';

export default function Title() {
	return (
		<div
			style={{
				fontWeight: 900,
				fontSize: '5rem',
				lineHeight: '4rem',
				textShadow: '0px 0px 10px rgba(0, 0, 0, .2)',
				background: 'black',

				position: 'absolute',
			}}
		>
			<div
				style={{
					fontSize: '3rem',
				}}
			>
				TRAVELING AROUND
			</div>
			<div
				style={{
					fontSize: '5rem',
				}}
			>
				THE&nbsp;WORLD
			</div>
			<div
				style={{
					fontSize: '3.1rem',
				}}
			>
				HAS &nbsp; NEVER &nbsp; BEEN
			</div>
			<div
				style={{
					fontSize: '7rem',
				}}
			>
				SO&nbsp;EASY
			</div>
		</div>
	);
}
